        var vectorSource = new ol.source.Vector({
            features: new ol.format.GeoJSON().readFeatures(supplyGeoJSON, {
                dataProjection: 'EPSG:3857',
                featureProjection: 'EPSG:3857'
            })
        });

        var vectorLayer = new ol.layer.Vector({
            source: vectorSource,
            style: new ol.style.Style({
                image: new ol.style.Circle({
                    radius: 6,
                    fill: new ol.style.Fill({ color: 'blue' }),
                    stroke: new ol.style.Stroke({ color: 'white', width: 2 })
                })
            })
        });

        var demandVectorSource = new ol.source.Vector({
            features: new ol.format.GeoJSON().readFeatures(demandGeoJSON, {
                dataProjection: 'EPSG:3857',
                featureProjection: 'EPSG:3857'
            })
        });

        var demandVectorLayer = new ol.layer.Vector({
            source: demandVectorSource,
            style: new ol.style.Style({
                stroke: new ol.style.Stroke({ color: 'red', width: 2 }),
                fill: new ol.style.Fill({ color: 'rgba(255, 0, 0, 0.3)' })
            })
        });

        var circleSource = new ol.source.Vector();
        var circleLayer = new ol.layer.Vector({
            source: circleSource,
            style: new ol.style.Style({
                fill: new ol.style.Fill({ color: 'rgba(0, 0, 255, 0.2)' }),
                stroke: new ol.style.Stroke({ color: 'blue', width: 2 })
            })
        });

        map.addLayer(demandVectorLayer);
        map.addLayer(circleLayer);
        map.addLayer(vectorLayer);

        var popup = document.getElementById('popup');

        map.on('click', function(event) {
    var feature = map.forEachFeatureAtPixel(event.pixel, function(feature) {
        return feature;
    });

    if (feature) {
        var coords;
        
        // If clicked feature is a supply point
        if (feature.get('Service Name')) {
            coords = feature.getGeometry().getCoordinates();
            var name = feature.get('Service Name');
            var capacity = feature.get('No. Of Children Service Can Accommodate');

            popup.innerHTML = `<b>${name}</b><br>Capacity: ${capacity} children<br>
                <button onclick="setRadius(${coords[0]}, ${coords[1]})">Set Radius</button>`;
            popup.style.left = event.pixel[0] + "px";
            popup.style.top = event.pixel[1] + "px";
            popup.style.display = "block";

        // If clicked feature is a demand ED
        } else if (feature.get('ED_ENGLISH')) {
            coords = event.coordinate;  // Use event coordinate for polygons
            var edName = feature.get('ED_ENGLISH');
            var totalDemand = feature.get('Total') || 0;
            var t1 = feature.get('T1') || 0;
            var t2 = feature.get('T2') || 0;
            var t3 = feature.get('T3') || 0;
            var t4 = feature.get('T4') || 0;

            popup.innerHTML = `<b>${edName}</b><br>
                Total Demand: ${totalDemand}<br>
                T1: ${t1} | T2: ${t2} | T3: ${t3} | T4: ${t4}`;
            popup.style.left = event.pixel[0] + "px";
            popup.style.top = event.pixel[1] + "px";
            popup.style.display = "block";
        } else {
            popup.style.display = "none";  // Hide popup if nothing relevant is clicked
        }
    } else {
        popup.style.display = "none";  // Hide popup if clicked on empty space
    }
});

function setRadius(x, y) {
    var radiusKm = prompt("Enter radius in kilometers:");
    if (radiusKm && !isNaN(radiusKm)) {
        var radiusMeters = parseFloat(radiusKm) * 1000;

        // Clear previous circle and create a new one
        circleSource.clear();
        var circleFeature = new ol.Feature({
            geometry: new ol.geom.Circle([x, y], radiusMeters)
        });
        circleSource.addFeature(circleFeature);

        // Calculate supply within the radius
        var totalSupply = 0;
        vectorSource.getFeatures().forEach(function(feature) {
            var supplyCoords = feature.getGeometry().getCoordinates();
            var capacity = parseInt(feature.get('No. Of Children Service Can Accommodate')) || 0;
            var distance = Math.sqrt(Math.pow(x - supplyCoords[0], 2) + Math.pow(y - supplyCoords[1], 2));

            if (distance <= radiusMeters) {
                totalSupply += capacity;
            }
        });

        // Calculate demand within the radius (Now includes T0)
        var totalDemand = 0, t0 = 0, t1 = 0, t2 = 0, t3 = 0, t4 = 0;
        var circleGeometry = new ol.geom.Circle([x, y], radiusMeters);

        demandVectorSource.getFeatures().forEach(function(feature) {
            var polygon = feature.getGeometry();
            
            if (polygon.intersectsExtent(circleGeometry.getExtent())) {
                totalDemand += feature.get('Total') || 0;
                t0 += feature.get('T0') || 0;  // Include T0
                t1 += feature.get('T1') || 0;
                t2 += feature.get('T2') || 0;
                t3 += feature.get('T3') || 0;
                t4 += feature.get('T4') || 0;
            }
        });

        // Update the info-box
        document.getElementById("supply-text").textContent = totalSupply;
        document.getElementById("demand-total").textContent = totalDemand;
        document.getElementById("demand-t1").textContent = t1;
        document.getElementById("demand-t2").textContent = t2;
        document.getElementById("demand-t3").textContent = t3;
        document.getElementById("demand-t4").textContent = t4;

        // Add T0 display
        var t0Element = document.getElementById("demand-t0");
        if (!t0Element) {
            var newT0Element = document.createElement("p");
            newT0Element.innerHTML = `<b>T0:</b> <span id="demand-t0">0</span>`;
            document.getElementById("info-box").insertBefore(newT0Element, document.getElementById("demand-t1").parentNode);
        }
        document.getElementById("demand-t0").textContent = t0;

        document.getElementById("info-box").style.display = "block";

        // Hide popup
        popup.style.display = "none";
    }
